import React from 'react';
import styled from 'styled-components';
import Container from "./Container";

const ToolBar = styled.div`
  display: flex;
  & > div {
    display: flex;
    flex-direction: column;  
  }
`;

const SearchInput = styled.div`
  align-self: flex-end;
`;


export default function Tab1() {
  return (
    <Container>
      {/* Toolbar */}
      <ToolBar>
        <div>
          error
          <div>
            <input type="text" />
            <button>Add</button>
          </div>
        </div>
        <SearchInput>
          <input type="text" />
        </SearchInput>
        {/* toggle */}
        <div>
          Hide add toggle
          <input type="checkbox" />
        </div>
      </ToolBar>
    </Container>
  )
}
